import React from 'react';
import './Facilities.css';

const Facilities = () => {
  const facilities = [
    { 
      name: 'Outdoor Pool', 
      icon: 'https://cdn-icons-png.flaticon.com/512/2853/2853306.png' 
    },
    { 
      name: '1 Bathtub', 
      icon: 'https://cdn-icons-png.flaticon.com/512/190/190708.png' 
    },
    { 
      name: 'Free Wi-Fi', 
      icon: 'https://cdn-icons-png.flaticon.com/512/2936/2936919.png' 
    },
    { 
      name: 'Free Breakfast', 
      icon: 'https://cdn-icons-png.flaticon.com/512/3081/3081985.png' 
    },
    { 
      name: 'Bee Accessible', 
      icon: 'https://cdn-icons-png.flaticon.com/512/284/284443.png' 
    }
  ];

  return (
    <div className="facilities-container">
      <h3 className="facilities-title">FACILITIES</h3>
      <div className="facilities-scroll">
        {facilities.map((facility, index) => (
          <div key={index} className="facility-card">
            <img 
              src={facility.icon} 
              alt={facility.name}
              className="facility-icon" 
            />
            <p className="facility-name">{facility.name}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Facilities;
